function FlashSale() {
  const now = new Date();
  const hr = now.getHours();
  const min = now.getMinutes();
  const sec = now.getSeconds();

  return (
    <div>
      <div class="pd-flash-wrap">
        <span class="flash-header">Flash Sale</span>
        <span class="timer">
          <ul>
            <li>{hr}</li> :<li>{min}</li> :<li>{sec}</li>
          </ul>
        </span>
      </div>
    </div>
  );
}

export default FlashSale;
